import './App.css';
import Row from './Row';
import requests from './requests'

function App() {
  return (
    <div className="App">
     <h1> Hey lets build netflix clone today!!</h1>
     <Row title="Netflix Originals" fetchURL={requests.fetchNetflixOriginals}/>
     <Row title="Trending Now" fetchURL={requests.fetchTrending}/>
    </div>
  );
}

export default App;
